import React from 'react';
import { Exercise } from '../types/Exercise';
import { ExerciseLog } from '../types/ExerciseLog';

interface SweatListCardProps {
  log: ExerciseLog;
}

const SweatListCardView: React.FC<SweatListCardProps> = ({ log }) => {
  return (
    <div className="flex bg-transparent rounded-none h-36">
      {log.exercise.videos.length > 0 ? (
        <div className="relative w-24 h-24 ml-4 overflow-hidden rounded-2xl">
          <video
            src={log.exercise.videos[log.exercise.currentVideoPosition]?.videoURL}
            className="object-cover w-full h-full"
            muted
            autoPlay
            loop
          />
          <div className="absolute top-0 left-0 w-full h-full bg-gradient-to-b from-secondaryCharcoal/60 to-transparent" />
        </div>
      ) : (
        <div className="w-24 h-24 ml-4 rounded-2xl bg-gray-300" />
      )}

      <div className="flex flex-col justify-center ml-4">
        <h3 className="text-sm font-bold text-secondaryWhite">{log.exercise.name}</h3>
        <p className="text-sm text-secondaryWhite/80">{`${log.exercise.sets} x ${log.exercise.reps}`}</p>
      </div>
    </div>
  );
};

export default SweatListCardView;
